import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Profile from './components/Profile/Profile'; // компонент профиля с вложенными маршрутами
import BookingPage from './components/Booking/BookingPage'; // страница бронирования

function App() {
  return (
    <Router>
      <nav style={{ marginBottom: 20 }}>
        <Link to="/" style={{ marginRight: 10 }}>Home</Link>
        <Link to="/login" style={{ marginRight: 10 }}>Login</Link>
        <Link to="/register" style={{ marginRight: 10 }}>Register</Link>
        <Link to="/profile" style={{ marginRight: 10 }}>Profile</Link>
        <Link to="/booking" style={{ marginRight: 10 }}>Booking</Link> {/* Ссылка на страницу брони */}
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/profile/*" element={<Profile />} />
        <Route path="/booking" element={<BookingPage />} /> {/* Роут для бронирования */}
      </Routes>
    </Router>
  );
}

export default App;
